var title_f12_34_12832="Wrist arthrocentesis";
var content_f12_34_12832=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F81500&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F81500&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Wrist arthrocentesis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 414px; height: 332px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The needle is inserted at a point just distal to the radius and just ulnar to the anatomic snuff box (arrow). It is then directed perpendicularly. If bone is hit, the needle should be pulled back and slightly redirected toward the thumb.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from Owen, DS. Aspiration and injection of joints in soft tissue. In: Textbook of Rheumatology, 4th edition, Kelley, WN, Harris, ED Jr, Ruddy, S (Eds), WB Saunders, Philadelphia 1993. p.545.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
