"       </td>",
"       <td class=\"subtitle1\">",
"        25 OHD",
"       </td>",
"       <td class=\"subtitle1\">",
"        1,25 (OH)",
"        <sub>",
"         2",
"        </sub>",
"        D",
"       </td>",
"       <td class=\"subtitle1\">",
"        Urine calcium",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        <strong>",
"         Calcipenic rickets",
"        </strong>",
"       </td>",
"       <td>",
"        Vitamin D deficient rickets",
"       </td>",
"       <td class=\"centered\">",
