"        &darr;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hereditary vitamin D resistant rickets (vitamin D dependent type 2)",
"       </td>",
"       <td class=\"centered\">",
"        &darr;",
"       </td>",
"       <td class=\"centered\">",
"        &darr; or N",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;&uarr;",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
