"        &darr;",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        <strong>",
"         Phosphopenic rickets",
"        </strong>",
"       </td>",
"       <td>",
"        X-linked hypophosphatemia",
"       </td>",
"       <td class=\"centered\">",
"        N",
"       </td>",
"       <td class=\"centered\">",
"        &darr;&darr;",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
"       <td class=\"centered\">",
"        N or slightly &uarr;",
"       </td>",
"       <td class=\"centered\">",
"        N",
"       </td>",
"       <td class=\"centered\">",
"        N or &darr;",
"       </td>",
"       <td class=\"centered\">",
"        &darr;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hereditary hypophosphatemic rickets with hypercalciuria",
"       </td>",
"       <td class=\"centered\">",
"        N",
"       </td>",
"       <td class=\"centered\">",
"        &darr; or &darr;&darr;",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
"       <td class=\"centered\">",
"        N or &darr;",
"       </td>",
"       <td class=\"centered\">",
"        N",
"       </td>",
