var title_f12_34_12846="Progression hep C by liver bx";
var content_f12_34_12846=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F72654&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F72654&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 556px\">",
"   <div class=\"ttl\">",
"    Progression of hepatitis C to cirrhosis according to baseline inflammation on initial liver biopsy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 536px; height: 326px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In this study of 70 patients with chronic hepatitis C virus infection, those with mild inflammation (portal inflammation alone or with only focal periportal extension) and no fibrosis on the initial liver biopsy had only a 1.2 percent annual risk of progressing to cirrhosis (blue line). In comparison, patients with moderate chronic hepatitis (periportal inflammation usually involving more than 30 percent of the limiting plate) had a 4.6 percent annual risk of developing cirrhosis (green line), and those with severe inflammation or bridging fibrosis had a high risk of progression (red line); nearly all in the last group developed cirrhosis within ten years.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Yano, M, Kumada, H, Kage, M, et al, Hepatology 1996; 23:1334.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
